Every node tree is required to return Geometry as the first output. Let's try returning a simple cube. @tree("Cube Tree")
def cube_tree(): return cube() Here we call the cube(...) function, which creates a Cube node and connects it to the Group Output . You can also return multiple values. However, Geometry must always be returned first for a tree to be valid. @tree("Cube Tree")
def cube_tree(): return cube(), 5

