Any node function can be called on a socket type. This will automatically connect the socket to the first input of the node. @tree("Cube Tree")
def cube_tree(size: Vector): return cube(size=size).mesh_to_volume() The output of the Cube node (a Geometry socket type) is connected to the first input of the Mesh to Volume node. The same script without chaining calls is written more verbosely as: @tree("Cube Tree")
def cube_tree(size: Vector): return mesh_to_volume(mesh=cube(size=size))

