A Geometry Script can have more than one tree function. Each tree function is a node group, and tree functions can be used in other tree functions to create Node Group nodes. @tree("Instance Grid")
def instance_grid(instance: Geometry): """ Instance the input geometry on a grid """ return grid().mesh_to_points().instance_on_points(instance=instance) @tree("Cube Grid")
def cube_grid(): """ Create a grid of cubes """ return instance_grid(instance=cube(size=0.2)) The Cube Grid tree uses the Instance Grid node group by calling the instance_grid function: The Instance Grid node group uses the passed in instance argument to create a grid of instances: This concept can scale to complex interconnected node trees, while keeping everything neatly organized in separate functions.

